import React from "react";
import { Link } from "react-router-dom";
import Hero from "../components/common/Hero";
import Container from "react-bootstrap/Container";
import Carousel from "react-bootstrap/Carousel";

import Cheetah from '../assets/animal/cheetah.jpeg';
import Lion from '../assets/animal/tiger.jpeg'
const Home = () => {
  const values = {
    title: "WELCOME TO DEEPTHI'S WEB PORTFOLIO",
    content: " IT PROFESSIONAL",
    button: (
      <Link to="/contact" className="btn btn-dark btn-block">
        Contact Me
      </Link>
    ),
    variant: "dark",
  };
  return (
    <Container>
      <Hero values={values} />
     
 <Carousel className="mt-5">
<Carousel.Item>
   <img className="d-block w-100" src={Cheetah} alt="Fist Slide"/>
</Carousel.Item>

 </Carousel>


    </Container>
  );
};
export default Home;
